import { Routes, Route, BrowserRouter } from "react-router-dom";
import './App.css';
import Login from './login';
import schedule_appoint from './schedule_appoint';
import Register from './form';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
     <Routes>
      <Route path="/" element={<Login/>}/>
      <Route path="/appointment" element={schedule_appoint}/>
      <Route path="/register" element={Register}/>
     </Routes>
     </BrowserRouter>
    </div>
  );
}

export default App;
